Values can be borrowed without transferring ownership. bob-dylan-borrow // Function takes a reference as a parameter (&T)
fn borrow(v: &Vec<i32>) { // Does stuff with `v`
} #fn main() {
let mut bob = vec![1, 2, 3]; // Give a reference (&) to bob's value
borrow(&bob); bob.push(4); // Still okay!
