} # fn main() { borrow(&vec![1, 2, 3]); }
fn borrow(v: &Vec<i32>) { v.push(1); // ERROR!
} Mutable borrows (&mut) CAN modify the value. dylan-feed // Function takes a mutable reference as a parameter (&mut T)
fn change(v: &mut Vec<i32>) { v.push(4);
} #fn main() {
let mut bob = vec![1, 2, 3]; // Give a mutable reference
change(&mut bob); // Okay!
bob.push(5);
println!("{:?}", bob);
#} Note: if bob was not declared as a mut variable, it couldn't be mutably borrowed. This ensures that, to anyone reading the code, if a variable is not declared as mutable, it will NEVER be updated under any circumstance. (this is technically untrue if we were to dive into the spooky world of unsafe Rust , but that's not going to be talked about here)

