In Rust, the Option<T> type is often used to refer to a value that may or may not exist. Option<T> may have two variations: Some(T) for when a value is present None for when a value is absent #fn main() {
let mut maybe = Some(12);
println!("{:?}", maybe); maybe = None;
println!("{:?}", maybe);
#} A built-in function in Rust that returns an Option<T> is Vec::pop, which removes and returns the last value of a vector: #fn main() {
let mut v = vec![1, 2]; println!("{:?}", v.pop());
println!("{:?}", v.pop());
println!("{:?}", v.pop());
#} Why not null? A common question is "Why not just use null like other languages?" and the biggest reason is to prevent "null dereferencing" or NullPointerExceptions. In a language like Java where objects can be set to null whenever they want, you often don't know when you should have null-checks or not, so you usually just put them everywhere or risk a runtime exception. In Rust, however, that isn't necessary! If a value is of type T, you know it definitely exists, and so you have no fear of a possible null dereference. If a value is of type Option<T>, the Rust compiler forces you to do the check because it may or may not be a valid value, meaning you run no risk of a runtime error.

